import React, { useState } from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  const [email, setEmail] = useState("");

  return (
    <div className="App">
      <form>
        <div>
          <input
            type="email"
            placeholder="Enter Email"
            name="email"
            id="email"
            required
            value={email}
            onChange={(event) => setEmail(event.target.value)}
          />
        </div>
      </form>
    </div>
  );
}

export default App;
